import React, { useEffect, useState } from 'react'
import {Link} from 'react-router-dom'
import axios from 'axios';
import LoginForm from '../components/LoginForm';

const Login = (props) =>{


    return(
        <div>
            <p className="goBack">
            <Link to="/">Go Back</Link>
            </p>
            {<LoginForm/>}
        </div>
    )
}
export default Login
